import React from "react";

function Address(){
    return(
  <>
  <div className="address">
      <p><i className="fas fa-map-marker-alt" id="icon"></i> Near E block main Gate ,Vatika India Next ,sector 82,Gurgoan Haryana</p>
  </div>
  </>
    );
}

export default Address;
